"     Reported Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Topical treatment of fungal infections of skin and nails",
"    </p>",
"   </div>",
"   <div class=\"block idos drugH1Div\" id=\"F1977944\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Adults: Topical: Apply to affected area once daily, preferably before going to bed. Duration of treatment is 2-4 weeks depending on the indication.",
"    </p>",
"   </div>",
