" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Zinc oxide: Drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_patient\" href=\"UTD.htm?14/25/14740?source=see_link\">",
"    see \"Zinc oxide: Patient drug information\"",
"   </a>",
"   and",
