"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F235778\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      Ammens&reg; Original Medicated [OTC];",
"     </li>",
"     <li>",
"      Ammens&reg; Shower Fresh [OTC];",
"     </li>",
"     <li>",
"      Balmex&reg; [OTC];",
"     </li>",
"     <li>",
"      Boudreaux's&reg; Butt Paste [OTC];",
"     </li>",
"     <li>",
"      Critic-Aid Skin Care&reg; [OTC];",
"     </li>",
"     <li>",
"      Desitin&reg; Creamy [OTC];",
"     </li>",
"     <li>",
"      Desitin&reg; [OTC]",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"list cbnlist drugH1Div drugBrandNames\" id=\"F235779\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: Canada",
"    </span>",
"    <ul>",
"     <li>",
"      Zincofax&reg;",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F235787\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      Topical Skin Product",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F235780\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Protectant:",
"     </b>",
"     Topical: Apply as required to affected areas several times daily",
"    </p>",
"   </div>",
"   <div class=\"block dop drugH1Div\" id=\"F235784\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Pediatric",
"    </span>",
"    <p>",
"     (For additional information",
"     <a class=\"drug drug_pediatric\" href=\"UTD.htm?31/11/31922?source=see_link\">",
"      see \"Zinc oxide: Pediatric drug information\"",
"     </a>",
"     )",
"    </p>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Protectant:",
"     </b>",
"     Topical: Apply as required to affected areas several times daily",
"    </p>",
"   </div>",
"   <div class=\"block doe drugH1Div\" id=\"F235781\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Geriatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F235771\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Excipient information presented when available (limited, particularly for generics); consult specific product labeling.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Cream, topical:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Balmex&reg;: 11.3% (60 g, 120 g, 480 g) [contains aloe, benzoic acid, soybean oil, and vitamin E]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Cream, topical [stick]:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Balmex&reg;: 11.3% (56 g) [contains aloe, benzoic acid, soybean oil, and vitamin E]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Ointment, topical: 20% (30 g, 60 g, 454 g); 40% (120 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Desitin&reg;: 40% (30 g, 60 g, 90 g, 120 g, 270 g, 480 g) [contains cod liver oil and lanolin]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Desitin&reg; Creamy: 10% (60 g, 120 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Paste, topical:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Boudreaux's&reg; Butt Paste: 16% (30 g, 60 g, 120 g, 480 g) [contains castor oil, boric acid, mineral oil, and Peruvian balsam]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Critic-Aid Skin Care&reg;: 20% (71 g, 170 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Powder, topical:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Ammens&reg; Original Medicated: 9.1% (312 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Ammens&reg; Shower Fresh: 9.1% (312 g)",
"    </p>",
"   </div>",
"   <div class=\"block geq drugH1Div\" id=\"F235761\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Generic Equivalent Available: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Yes: Ointment",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F235772\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Protective coating for mild skin irritations and abrasions; soothing and protective ointment to promote healing of chapped skin, diaper rash",
"    </p>",
"   </div>",
"   <div class=\"block ars drugH1Div\" id=\"F235785\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Adverse Reactions Significant",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     1% to 10%: Local: Skin sensitivity, irritation",
"    </p>",
"   </div>",
"   <div class=\"block coi drugH1Div\" id=\"F235774\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Contraindications",
"    </span>",
