var title_f14_53_15196="Female sexual history";
var content_f14_53_15196=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F71711&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=12\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F71711&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=12\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Female sexual dysfunction: Taking a sexual history",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Questions about sexual activity should be specific. Assumptions should not be made about the gender or number of a patient's sexual partners or about how the patient interprets \"sexual activity.\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        For each complaint, it is important to assess:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Is it new, chronic, or intermittent?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Does it cause personal distress or interpersonal difficulty?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Is it generalized or does it occur only in certain settings or with a specific partner?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Useful questions:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        What is your principle sexual concern (eg, low desire, difficulty with orgasm, dyspareunia)?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        When were you last satisfied with your sex life? Describe the frequency of sexual activity and your level of desire, arousal and response at that time versus now.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        When did you start to notice a change that was bothersome to you? Do you have any idea what may have occurred at that time that contributed to the problem (eg, infertility, birth of child, depression, new medication, cancer diagnosis, menopause, issue with partner)?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Do you believe stress, fatigue, or limited privacy are contributing to your sexual problem?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        If the patient has a partner:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Describe your partner (age, general health, duration of relationship), including his/her level of sexual interest and function [eg, erectile dysfunction]).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Describe your relationship with your partner (eg, caring, communicative, loving, strained). How often do you spend time together as a couple, without family or friends present? Describe your last vacation together; was the sexual problem still present? Improved?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Is your sexual problem causing stress in the relationship? Do you and your partner talk about sexuality? Have you ever met with a counselor or sex therapist to discuss sexual problems?",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
